import React, {useState} from 'react';
import {useNavigate} from "react-router-dom";

import '../styles/admin.scss'

const Admin = () => {
    const navigate = useNavigate()
    const [password, setPassword] = useState('')

    const handleNavigate = (e) => {
        window.scrollTo({
            top: 0,
            left: 0
        })
        navigate(`${e.target.id}`)
    }

    const submitPassword = () => {
        console.log(password, process.env.REACT_ADMIN)
        if (password == process.env.REACT_ADMIN) {
            console.log('success')
        }
    }

    const handlePassword = (e) => {
        setPassword(e.target.value)
    }

    return (
        <div className="ContentContainer">
            <div className="TopLink">
                <div className="Link" id="/" onClick={handleNavigate}>Главная</div>
                <div>&nbsp;/ Панель администратора</div>
            </div>
            <h1 className="AdminSub">Панель администратора</h1>
            <input className="AdminPassword" type="password" value={password} onChange={handlePassword} onKeyPress={(e) => {if(e.key === 'Enter') submitPassword()}} />
            <button className="AdminSubmit" onclose={submitPassword()}>ВОЙТИ</button>
        </div>
    )
}

export default Admin
